import { url } from './url';
import axios from 'axios';

export default function postData(endPoint, method, body, token) {
    return axios({
        method: method,
        url: `${url}/${endPoint}`,
        data: JSON.stringify(body),
        headers: {
            "Authorization": token,
            "Content-Type": "application/json"
        }
    })
    .catch(err=>{
        console.log("API error",err)
    })
}
